import React from "react";
import ProjectTile from "../components/projectTile";

const projectsData = [
  {
    id: 1,
    name: 'Solar Potential Checker',
    thumbnail: '',
    description: 'React website that uses Google Places APIs and allows user customizations to check solar potential of a house',
    path: ''
  },
  {
    id: 2,
    name: 'Best of Reddit',
    thumbnail: './bestofreddit.png',
    description: 'React website that fetches data from Reddit API and uses Redux store',
    path: ''
  },
  {
    id: 3,
    name: 'Meal Planner',
    thumbnail: './mealsuggestor.png',
    description: 'React website that gives suggestions for each meal of the day',
    path: '/meal-suggestor'
  }
]

export default function Projects() {
  return (
    <div>
      <div className="about-me-bg-1"></div>
      <div className="about-me-bg-2"></div>
      <div className="page-container">
      <p id="my-projects">My projects</p>
      <div className="projects-list">
        {projectsData.map(project => (<ProjectTile project={project} />) )}
      </div>
      </div>
    </div>
  )
}
